import db from "../models/index";
import CRUDService from "../services/CRUDService";

// Trang chủ
let getHomePage = async (req, res) => {
    try {
        let data = await db.User.findAll();
        return res.render("homepage.ejs", {
            data: JSON.stringify(data),
        });
    } catch (e) {
        console.log("Error in getHomePage:", e);
        return res.status(500).send("Internal Server Error");
    }
};

// Trang About
let getAboutPage = (req, res) => {
    return res.render("test/about.ejs");
};

// Form CRUD
let getCRUD = (req, res) => {
    return res.render("crud.ejs");
};

// Xử lý tạo user
let postCRUD = async (req, res) => {
    try {
        let message = await CRUDService.createNewUser(req.body);
        console.log("Create user message:", message);
        return res.send("post crud from server");
    } catch (e) {
        console.log("Error in postCRUD:", e);
        return res.status(500).send("Internal Server Error");
    }
};

// Hiển thị tất cả user
let displayGetCRUD = async (req, res) => {
    try {
        let data = await CRUDService.getAllUsers();
        console.log("All users:", data);
        return res.render("displayCRUD.ejs", {
            dataTable: data,
        });
    } catch (e) {
        console.log("Error in displayGetCRUD:", e);
        return res.status(500).send("Internal Server Error");
    }
};

// Lấy thông tin user để edit
let getEditCRUD = async (req, res) => {
    try {
        let userId = req.query.id;
        if (userId) {
            let userData = await CRUDService.getUserInfoById(userId);
            if (userData) {
                return res.render("editCRUD.ejs", {
                    user: userData,
                });
            } else {
                return res.send("User not found!");
            }
        } else {
            return res.send("User ID not provided!");
        }
    } catch (e) {
        console.log("Error in getEditCRUD:", e);
        return res.status(500).send("Internal Server Error");
    }
};

// Cập nhật user
let putCRUD = async (req, res) => {
    try {
        let data = req.body;
        let allUsers = await CRUDService.updateUserData(data);
        return res.render("displayCRUD.ejs", {
            dataTable: allUsers,
        });
    } catch (e) {
        console.log("Error in putCRUD:", e);
        return res.status(500).send("Internal Server Error");
    }
};

module.exports = {
    getHomePage,
    getAboutPage,
    getCRUD,
    postCRUD,
    displayGetCRUD,
    getEditCRUD,
    putCRUD,
};

